INSERT INTO public.profiles (id,created_at,firebase_auth_id,display_name,is_verified,country,photo_url,about,tenant_id,username,roles,impact,is_blocked_from_messaging,is_contactable,is_supporter,links,location,notification_settings,patreon,tags,total_useful,total_views,type) VALUES (9, DEFAULT, '973c31a8-0095-50d6-aff1-943d6307ce55', 'Jere Erickson', 't', 'Portugal', NULL, 'Passionate about creating meaningful connections and exploring new experiences. Whether it''s traveling to new destinations, trying new foods, or diving into fresh hobbies, I''m all about embracing the adventure in life. Let''s chat and share our stories!', 'dcb90450-9ce8-56b6-bca5-347d4c8937db', 'jereerickson92', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (10, DEFAULT, '9cd6045e-b5b8-5901-b2e9-3849aebbd0e1', 'Alda Plaskett', 't', 'Spain', NULL, 'Tech enthusiast, avid reader, and coffee lover. I spend my days coding, learning about the latest trends, and finding ways to innovate. Always up for a deep conversation or a good book recommendation. Let''s connect and exchange ideas!', '2c8adecb-dc68-5a49-a528-d8b48c1f1494', 'aldaplaskett48', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (11, DEFAULT, 'b920e383-7833-514e-89a9-145ebbbc787e', 'Sampath Pini', 't', 'France', NULL, 'Fitness junkie who believes in the power of mental and physical health. When I''m not in the gym, you can find me hiking, practicing yoga, or experimenting with healthy recipes. Looking for like-minded people who value balance and growth. Let''s inspire each other!', 'd8eb9911-8c89-5e00-b7a2-e6108656c5e7', 'sampathpini67', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (12, DEFAULT, '4e5139b9-3558-5572-8bb1-ed37c4b52931', 'Galena Giugovaz', 't', 'Sudan', NULL, 'Curious traveler with a passion for photography and storytelling. Exploring the world, one city at a time, while capturing moments that tell unique stories. I believe that life is all about experiences and the memories we create. Let''s share the journey!', '6baa8099-decc-5e7d-8242-28f4ccad94c5', 'galenagiugovaz15', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (13, DEFAULT, 'c12ea762-93b0-54b6-8c10-ae3f3dcffd60', 'Veniamin Jewell', 't', 'Tuvalu', NULL, 'Creative soul with a love for design and innovation. I''m always experimenting with new ways to bring ideas to life—whether it''s through art, technology, or writing. Let''s collaborate and create something beautiful together!', '2576e620-563c-53d1-808b-9bfc0a0f765f', 'veniaminjewell33', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (14, DEFAULT, 'c55ef028-d4a2-5a0d-ba3b-a7a4204f5cfd', 'Cortney Brown', 't', 'Ukraine', NULL, 'Outgoing and energetic, I''m always looking for new adventures and opportunities to grow. Whether it''s trying a new hobby or tackling an exciting project, I''m up for anything. Join me on my journey, and let''s make the most out of every moment!', '230dc666-e34c-54e3-a489-6c3fa473ac90', 'cortneybrown81', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (15, DEFAULT, '1831fe53-587f-511f-a96e-6d75e175d4c3', 'Melisa Vang', 't', 'Uruguay', NULL, 'Music is my life, and I''m constantly seeking out new sounds and genres to explore. From playing instruments to attending live shows, I live and breathe rhythm. If you''re passionate about music or just want to chat about the latest trends, let''s connect!', 'd76d5b11-cc00-5814-a047-198ce539a93c', 'melisavang56', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (16, DEFAULT, '47c64cc1-9c98-52c2-b62b-6a178be86669', 'Liana Begam', 't', 'United States', NULL, 'Outdoor enthusiast and nature lover who finds peace in hiking, camping, and exploring the great outdoors. When I''m not soaking up the beauty of nature, you''ll find me sharing my love for the environment with others. Looking to meet fellow adventurers!', '8f26bd1e-0136-5878-9a31-9a731a546694', 'lianabegam24', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (17, DEFAULT, 'c159421b-a36b-5199-ab10-ec93562eddb6', 'Akrom Stárková', 't', 'Yemen', NULL, 'Ambitious and driven, I strive to make the most out of every opportunity. Whether it''s working on personal projects or helping others achieve their goals, I believe in continuous growth and learning. Let''s build a community of success together!', '5fdd4fea-f3c2-5033-aa5e-8f8facd37a76', 'akromstarkova72', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member'), (18, DEFAULT, 'edbc2023-1752-5abf-a3e8-9f273d296434', 'Mirzo Blažková', 't', 'Zimbabwe', NULL, 'Bookworm with a passion for storytelling and deep discussions. I''m always immersed in a good novel or seeking out new perspectives on life. Looking to connect with fellow book lovers or anyone interested in meaningful conversations. Let''s dive into the world of words together!', '97ab0742-9cb0-5953-80be-ce4a77f00a54', 'mirzoblazkova19', '{"user"}', 'null', 'f', 't', 't', 'null', 'null', 'null', 'null', '{}', 0, 0, 'member');
